import React from 'react';
import '../styles/Character.css';
import Jumbotron from "react-bootstrap/Jumbotron";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import {CHARACTER_PATH, CHARACTER_STAT_DISPLAY_NAME, ITEM_STAT_DISPLAY_NAME} from "../constants/routes";
import Image from "react-bootstrap/Image";
import Spinner from "react-bootstrap/Spinner";
import OverlayTrigger from "react-bootstrap/OverlayTrigger";
import Popover from "react-bootstrap/Popover";
import Tooltip from "react-bootstrap/Tooltip";
import Button from "react-bootstrap/Button";

class Character extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            characterData: {},
            isLoading: true,
        }
    }

    componentDidMount() {
        this.props.sendGetRequest(CHARACTER_PATH)
            .then((response) => {
                this.setState({characterData: response['data']});
                this.setState({isLoading: false});
            })
    }
    getItemImagePath = (gameItemType) => {
        return this.state.characterData['items'][gameItemType]['image_path'];
    };

    getItemDescription = (gameItemType) => {
        const item = this.state.characterData['items'][gameItemType];
        const stats = Object.keys(ITEM_STAT_DISPLAY_NAME).map(statName => {
            return (
                <p className="item-description-row">{ITEM_STAT_DISPLAY_NAME[statName]}: {item[statName]}</p>
            );
        });
        return (
            <Tooltip id="tooltip-bottom">
                <strong>{item['name']}</strong> <br />
                <small>{item['slot']}</small> <br />
                {stats}
            </Tooltip>
        )
    };

    renderImageWithDescription = (gameItemType, gameItemHeight) => {
        return (
            <OverlayTrigger
                trigger="hover"
                placement="bottom"
                overlay={this.getItemDescription(gameItemType)}
            >
                <Image
                    src={this.getItemImagePath(gameItemType)}
                    height={gameItemHeight}
                    alt="character helmet"
                />
            </OverlayTrigger>
        )
    };

    renderCharacterStats = () => {
        const char = this.state.characterData;
        const stats = Object.keys(CHARACTER_STAT_DISPLAY_NAME).map(statName => {
            return (
                <li>
                    <strong>{CHARACTER_STAT_DISPLAY_NAME[statName]}</strong>: {char[statName]}
                    <Button
                        className="stats-button btn-circle"
                        variant="primary"
                        size="sm"
                        active={char['free_stats'] !== 0}
                        disabled={char['free_stats'] === 0}
                    >+</Button>
                </li>
            )
        });
        return (
            <ul className="list-unstyled">
                {stats}
            </ul>
        )
    };

    render() {
        console.log(this.state.characterData);

        if (!this.state.isLoading) {
            return (
                <Jumbotron className="character-view">
                    <Container>
                        <Row className="justify-content-center">
                            <Col md={0}>
                                <h3>{this.state.characterData['name']}</h3>
                            </Col>
                        </Row>

                        <Row className="justify-content-center">
                            <Col md={0}>
                                {this.renderImageWithDescription('helmet', 50)}
                            </Col>
                        </Row>
                        <Row className="justify-content-center">
                            <Col
                            lg={{offset: 6}} md={{offset: 6}} sm={{offset: 6}}
                            xl={{offset: 6}} xs={{offset: 6}}>
                                {this.renderImageWithDescription('amulet', 35)}
                            </Col>
                        </Row>

                        <Row className="justify-content-center">
                            <Col md="auto">
                                {this.renderImageWithDescription('weapon', 150)}
                            </Col>

                            <Col md="auto">
                                {this.renderImageWithDescription('armor', 155)}
                            </Col>

                            <Col md="auto">
                                {this.renderImageWithDescription('shield', 150)}
                            </Col>
                        </Row>
                        <Row>
                            <Col className="stats-viewer">
                                {this.renderCharacterStats()}
                            </Col>
                        </Row>
                    </Container>
                </Jumbotron>
            );
        }
        else {
            return (
                <Spinner
                    className='loading-spinner'
                    animation="border"
                    variant="primary"
                />
            )
        }
    }
}

export default Character;
